import Repository, { apiUrl } from './Repository';

class AuthRepository {
    constructor(callback) {
        this.callback = callback;
    }

    async getAllExampackage(payload) {
        const reponse = await Repository.get(`${apiUrl}/exampackage/status/Y?_start=${payload._start}&_limit=${payload._limit}&search=${payload.search}`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }

    async getInactiveExampackage(payload) {
        const reponse = await Repository.get(`${apiUrl}/exampackage/status/N?_start=${payload._start}&_limit=${payload._limit}`)
            .then(response => {
                return response.data;
            })

            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }

    async saveExampackage(formdata) {
        const reponse = await Repository.post(`${apiUrl}/exampackage/`, formdata)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }

    async editExampackage(categoryId, formdata) {
        const reponse = await Repository.put(`${apiUrl}/exampackage/Id/${categoryId}`, formdata)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }

    async inactiveCategory(data) {
        const reponse = await Repository.put(`${apiUrl}/exampackage/status`, data)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }

  
    
}

export default new AuthRepository();
